import './App.css';
import {Route,Link} from "react-router-dom";

import Header from "./components/header"
import HomePage from "./pages/home"
import FormationPage from "./pages/formations";
function App() {
  return(
    <div className="App">

	    <Header/>
      <Route path="./home" component={HomePage}></Route>

    </div>
  ) 
  // HOMEPAGE
  return (
    <div className="App">

	    <Header/>
      <HomePage/>

    </div>
  );
}

export default App;
